import React from 'react';
import '../Header/header.scss';
import {Link} from 'react-router-dom';
import Logo from '../../Assets/Logo/OriginalLogo.png';

function Header () {
    return (
        <div className="header">
            <Link><img className="header__logo" src={Logo} alt=""/></Link>
            <div className="header__rightContainer">
                <nav className="header__nav">
                    <li className="header__navItem">Home</li>
                    <li className="header__navItem">About</li>
                </nav>
                <button className="header__addBtn">Add Location</button>
            </div>
        </div>
    )
}

export default Header;
